import React from 'react';
import './App.css';
import Header from './components/basic/Header';
import HomeRouter from './routers/HomeRouter';

class App extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <HomeRouter />
      </div>
    );
  }
}

export default App;
